import React from "react";

import styled from "styled-components";

interface IProps {
    title: String,
}

const StyledNavItem = styled.p`
    font-size: small;
`;

const NavItem: React.FC<IProps> = ({ title }) => {
    return (<StyledNavItem>Hello</StyledNavItem>)
}

export default NavItem;
